Порадник для руху опору від Генерального штабу ЗСУ

Ваші прості дії мають велике значення в боротьбі з ворогом!

✅Зорієнтуйтесь на основному завданні, а саме: 

▫️знищенні/виведенні з ладу системи управління противника та роботи його тилу.

Є у вас зброя та патрони чи немає використовуйте усі можливі методи і способи боротьби:

🔻демонтуйте або ретельно замалюйте дорожні знаки, назви населених пунктів, щоб заплутати ворога;

🔻робіть лісові завали для унеможливлення просування ворога;

🔻будьте креативними, використовуйте інші інженерні спорудження та хитрощі;

🔻активно використовуйте саморобні запалювальні засоби;

🔻руйнуйте ключові вузли транспортної інфраструктури;

🔻підвищуйте активність у нічний час та сутінки.

❗️ЧП Україна

❗️Сводка от Генштаба по состоянию на 06:00 26.02.2022

Ориентировочные потери противника составляют: 

▫️самолеты – 14 единиц; 

▫️вертолеты – 8 ед.;

▫️танки – 102 ед.; 

▫️ББМ – 536 ед.; 

▫️пушек – 15 ед.;

▫️ ЗРК БУК-1 ед.

❗️ЧП Україна

